import React from 'react';
import '../../App.css';

function Contact() {
  return (
    <>
      <div style={{ textAlign: 'center', fontSize: '36px', marginBottom: '20px' }}>Send Us an Email</div>
      <div style={{ textAlign: 'center', fontSize: '20px' }}>
        <ul style={{ listStyleType: 'none', padding: '0' }}>
          <li><strong>Food Recovery Network:</strong> foodrecoverynetwork@brown.edu</li>
          <li><strong>Ayla Kim:</strong> ayla_kim@brown.edu</li>
          <li><strong>Emma Weech:</strong> emma_weech@brown.edu</li>
          <li><strong>Seth Peiris:</strong> seth_peiris@brown.edu</li>
          <li><strong>Alex Zeng:</strong> alexander_zeng@brown.edu</li>
          <li><strong>Suzie Zhang:</strong> chuyi_zhang1@brown.edu</li>
          <li><strong>David Veloso:</strong> david_veloso@brown.edu</li>
          <li><strong>Athena Deng:</strong> athena_deng@brown.edu</li>
          <li><strong>Ran Zhao:</strong> ran_zhao@brown.edu</li>
          <li><strong>Bailey Smoko:</strong> bailey_smoko@brown.edu</li>
          {/* Add more people and their emails as needed */}
        </ul>
      </div>
    </>
  );
}

export default Contact;
